import React, { Fragment } from "react";
import "./style.scss"
import logo from "../../img/header_logo/logo.png";

function navbar() {
    return(
        <Fragment>
            <div className="imagen"></div>
            <header>
                <div className="logo">
                    <img src={logo} className=""/>
                </div>
            </header>
                      
            
        </Fragment>
   )
    
}

export default navbar

